import React from 'react';


const Nav = () => {
    return (
      <nav class="navbar fixed-top navbar-expand-md navbar-dark bg-dark bold">
        <a class="navbar-brand" href="/">
          <span class="sr-only">(current)</span>Joe Yang
        </a>
        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarNavAltMarkup"
          aria-controls="navbarNavAltMarkup"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon fade"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div class="navbar-nav ml-auto">
            <a class="nav-item nav-link" href="#about">
              About
            </a>
            <a class="nav-item nav-link" href="#projects">
              Projects
            </a>
            <a class="nav-item nav-link" href="#tech">
              Technologies
            </a>
            <a class="nav-item nav-link" href="#contact">
              Contact
            </a>
          </div>
        </div>
      </nav>
    );
}

export default Nav;


